import React from "react";
import AppbarCustom from "../../components/appbar";
import { Container, Grid, MenuItem, Select } from "@mui/material";
import BreadcrumbsCustom from "../../components/breadcrumbs";
import "./index.scss";

function DashboardPage() {
  return (
    <div>
      <AppbarCustom />
      <Container style={{ maxWidth: "1300px", paddingTop: "24px" }}>
        <BreadcrumbsCustom data={["Home", "Produk", "Roasted Ban"]} />
        <Grid container spacing={1} paddingTop={"38px"}>
          <Grid item xs={6} md={4}>
            Filter
          </Grid>
          <Grid className="product-content" item xs={6} md={8}>
            <div className="header">
              <div>
                <span>Menampilkan</span>
                <Select
                  size="small"
                  // value={productsPerPage}
                  // onChange={handleProductsPerPageChange}
                  sx={{
                    border: "1px solid #F2F2F2",
                    background: "rgba(248, 248, 248, 0.75)",
                    width: "48px",
                    height: "30px",
                    "& .MuiSelect-root": {
                      paddingTop: 0,
                      paddingBottom: 0,
                    },
                    "& .MuiSelect-select": {
                      paddingRight: "20px",
                    },
                  }}
                >
                  <MenuItem value={10}>10 Produk</MenuItem>
                  <MenuItem value={20}>20 Produk</MenuItem>
                  <MenuItem value={50}>50 Produk</MenuItem>
                  <MenuItem value={100}>100 Produk</MenuItem>
                </Select>
              </div>
            </div>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}

export default DashboardPage;
